// Home.js
import React from 'react';
import pic from './assets/cat.jpeg';
import styled from 'styled-components';

const HomeContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: calc(100vh - 78px);
`;

const InfoContainer = styled.div`
  background-color: #f2f2f2;
  border-radius: 10px;
  padding: 20px;
  text-align: center;
  margin-bottom: 20px;
`;

const RoundedImage = styled.img`
  border-radius: 50%;
  width: 150px;
  height: 150px;
  object-fit: cover;
  margin-bottom: 20px;
`;

const NameTitle = styled.p`
  font-size: 20px;
  font-weight: bold;
  margin-bottom: 10px;
`;

const Home = () => {
  return (
    <HomeContainer>
      <InfoContainer>
        <RoundedImage src={pic} alt="Cute Cat" />
        <NameTitle>Roxana Halati (like the city Galati but with H)</NameTitle>
        <p style={{ fontSize: '16px' }}>Assistant PhD</p>
        <p style={{ fontSize: '16px', marginBottom: '10px' }}>UBB FMI</p>
        <p style={{ fontSize: '14px', marginBottom: '5px' }}>Email: example@example.com</p>
      </InfoContainer>

      <div>
        <p>
          Hi there! Thank you for visiting my website. Lorem Ipsum Dolor Sit Amet, consectetur adipiscing elit. Sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation
          ullamco laboris nisi ut aliquip ex ea commodo consequat.
        </p>
      </div>
    </HomeContainer>
  );
};

export default Home;
